/**Create database**/
CREATE DATABASE IF NOT EXISTS COMP1011Java;
/**Create table**/
USE COMP1011Java;
DROP TABLE IF EXISTS allUfoSightings;
CREATE TABLE IF NOT EXISTS allUfoSightings(
   sightingID  INT  NOT NULL PRIMARY KEY AUTO_INCREMENT
  ,city        VARCHAR(100) NOT NULL
  ,state       VARCHAR(10) NOT NULL
  ,country     VARCHAR(10) NOT NULL
  ,durationSec INTEGER  NOT NULL
  ,ufoShape    VARCHAR(30) NOT NULL
);
